  false,\n\t\"url\": null,\n\t\"notes\": \"The Conductivity, Temperature and Depth
  (CTD) and other data werencollected as part of Marine Mammal Cruises. Two year data
  consisting ofn381 casts was collected from NE Pacific (limit-180) using NOAA Ship
  DAVID STARR JORDAN. The data was collected over a period spanning fromnAugust 5,
  1986-November 30, 1988. Data was submitted by Mr. DavidnBehringer of Atlantic Oceanographic
  Meterological Laboratory, Miami, FL.nData has been processed and is available in
  F022-CTD-Hi Resolution filenformat of NODC.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
